"use strict";var stocks=[],socket=io();function getStockPrices(){var e=$("#stockCode").val();if(!e||""==e){alert("Stock code is required!");return}if(stocks.length>=5){alert("Maximum of 5 stocks to track");return}stocks.push(e.toUpperCase()),socket.emit("stocksrec",stocks),$("#stockCode").val("")}function removeStock(e){var t=stocks[e];socket.emit("removestock",t)}socket.on("stocks",function(e){console.log("received",e);var t=[];$("#key").empty(),e.forEach((e,o)=>{var s=e.split(" - ");$("#key").append("<li onClick='removeStock("+o+")'>"+e+"</li>"),t.push(s[0])}),stocks=t}),socket.on("message",function(e){console.log("receivedMessage",e)}),socket.on("stockgraph",function(e){$("#holder").empty(),$("#holder").append("<img class='pic' src='data:image/png;base64, "+e+"' alt='stocks'/>")}),document.getElementById("stockCode").addEventListener("keyup",function(e){"Enter"==e.key&&(e.preventDefault(),document.getElementById("btn").click())});